<?php

require_once "./vendor/autoload.php";

use BitWasp\Bitcoin\Address\AddressCreator;
use BitWasp\Bitcoin\Bitcoin;
use BitWasp\Bitcoin\Network\NetworkFactory;
use PHPUnit\Framework\TestCase;
use ZCash\ZCashBlockFactory;

class ZCashBlockParsingTest extends TestCase
{
    public function blockTestData()
    {
        return [
            "0000000002609482475355c753fa136b7700f3a2b86315f9287e9754d07a1a35" => [
                "hex" => "",
                "last_output" => "t1frgXTAjkLjzagdPhYiys8uCLyesNZxVL4",
                "transactions" => 3,
            ],
            "0000000005607e1b47f06b8b670673e3d87f7b8b8d9bb3efb2191c7fd54ba433" => [
                "hex" => "",
                "last_output" => "t1P4yFTvfSRYsWZhDxe81UT3UUHVNYuEzjR",
                "transactions" => 2,
            ],
            "0000000002b83aaff1cb36453f54ef0343cdb63fa48a46112dc0e0f3c3cfdd82" => [
                "hex" => "",
                "last_output" => "t1UzLgPbQQczxihLarKU8iAdCcS5KAJgNEs",
                "transactions" => 5,
            ],
            "000000000d4cf91ee06eb0b8c054df99d8899d1f2cebb101d73bbc060541f668" => [
                "hex" => "",
                "last_output" => "t1dHu36fLmgz4zfen96efbiQFSycTaL398w",
                "transactions" => 25,
            ],
            "000000000c046b767b1156ecabf70392dd9e4cc6fca63db1e6740935b43a8a9c" => [
                "hex" => "",
                "last_output" => "t1NBxc5DP5AAoWCPUK7WxDNGuutmdLkRG3a",
                "transactions" => 26,
            ],
        ];
    }

    /**
     * @dataProvider blockTestData
     * @test
     */
    public function decodeZcashBlock($hex, $last_output, $transactions)
    {
        $network = NetworkFactory::zcash();
        Bitcoin::setNetwork($network);

        $block = ZCashBlockFactory::fromHex($hex);
        $this->assertCount($transactions, $block->getTransactions());

        $txs      = $block->getTransactions();
        $tx       = array_pop($txs);
        $outs     = $tx->getOutputs();
        $last_out = array_pop($outs);

        $this->assertEquals($last_output, (new AddressCreator)->fromOutputScript($last_out->getScript())->getAddress());
    }
}
